import React from "react";
import CardItem from "../CardItem/CardItem";
import "./Cards.scss";

function Cards({ data }) {
  const renderTwoProducts = () => {
    return data.slice(0, 2).map((places) => {
      return <CardItem key={places.id} {...places} />;
    });
  };
  const renderThreeProducts = () => {
    return data.slice(1, 5).map((places) => {
      return <CardItem key={places.id} {...places} />;
    });
  };

  return (
    <div className="cards">
      <h1 className="cards__title">Check out the locations here</h1>
      <div className="cards__container">
        <div className="cards__wrapper">
          <ul className="cards__items">
            <div>{renderTwoProducts()}</div>
          </ul>
          <ul className="cards__items">
            <div>{renderThreeProducts()}</div>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Cards;
